  },
  computed: {
    fillColor() {
      const colorPallete = this.$vuetify.theme.defaults.light
      if (this.isUnableToBeFilled) {
        return colorPallete.error //error
      } else {
        return this.isFilled
          ? colorPallete.success // success
          : colorPallete.info
      }
    }
  }
